import React from "react";
import { Space } from "antd";
import { ProjectCard } from "./ProjectCard"

const Portfolio = () => {
  return (
      <div className="portfolio-wrapper">
        <h2>Portfolio</h2>
        <Space wrap>
          <ProjectCard title="123" description="456" />
        </Space>
      </div>
  );
}; 

export default Portfolio;
